                if ((condensed_key = @sgp.parse(c, sa, sp, sl)) < 0)
                  return @sgp.error
                end
                # Surogate.toUCS4 looks like
                # (((high & 0x3ff) << 10) | (low & 0x3ff)) + 0x10000;
                # so we add (0x2e248 - 0x10000) to get the "key".
                condensed_key += 0x1e248
                @current_state = GB18030_FOUR_BYTE
                input_size = @sgp.increment
              else
                if (c >= 0x0 && c <= 0x7f)
                  @current_state = GB18030_SINGLE_BYTE
                else
                  if (c <= 0xa4c6 || c >= 0xe000)
                    out_byte_val = get_gb18030(EncoderIndex1, self.attr_encoder_index2, c)
                    if ((out_byte_val).equal?(0xfffd))
                      return CoderResult.unmappable_for_length(1)
                    end
                    hi_byte = (out_byte_val & 0xff00) >> 8
                    lo_byte = (out_byte_val & 0xff)
                    condensed_key = (hi_byte - 0x20) * 256 + lo_byte
                    if (c >= 0xe000 && c < 0xf900)
                      condensed_key += 0x82bd
                    else
                      if (c >= 0xf900)
                        condensed_key += 0x93a9
                      end
                    end
                    if (hi_byte > 0x80)
                      @current_state = GB18030_DOUBLE_BYTE
                    else
                      @current_state = GB18030_FOUR_BYTE
                    end
                  else
                    if (c >= 0xa4c7 && c <= 0xd7ff)
                      condensed_key = c - 0x5543
                      @current_state = GB18030_FOUR_BYTE
                    end
                  end
                end
              end
              case (@current_state)
              when GB18030_SINGLE_BYTE
                if (dl - dp < 1)
                  return CoderResult::OVERFLOW
                end
                da[((dp += 1) - 1)] = c
              when GB18030_DOUBLE_BYTE
                if (dl - dp < 2)
                  return CoderResult::OVERFLOW
                end
                da[((dp += 1) - 1)] = hi_byte
                da[((dp += 1) - 1)] = lo_byte
              when GB18030_FOUR_BYTE
                # Four Byte encoding
                b1 = 0
                b2 = 0
                b3 = 0
                b4 = 0
                if (dl - dp < 4)
                  return CoderResult::OVERFLOW
                end
                # Decompose the condensed key into its 4 byte equivalent
                b4 = ((condensed_key % 10) + 0x30)
                condensed_key /= 10
                b3 = ((condensed_key % 126) + 0x81)
                condensed_key /= 126
                b2 = ((condensed_key % 10) + 0x30)
                b1 = ((condensed_key / 10) + 0x81)
                da[((dp += 1) - 1)] = b1
                da[((dp += 1) - 1)] = b2
                da[((dp += 1) - 1)] = b3
                da[((dp += 1) - 1)] = b4
              else
                raise AssertError if not ((false))
              end
              sp += input_size
            end
            return CoderResult::UNDERFLOW
          ensure
            src.position(sp - src.array_offset)
            dst.position(dp - dst.array_offset)
          end
        end
        
        typesig { [class_self::CharBuffer, class_self::ByteBuffer] }
        def encode_buffer_loop(src, dst)
          condensed_key = 0
          hi_byte = 0
          lo_byte = 0
          @current_state = GB18030_DOUBLE_BYTE
          mark = src.position
          begin
            while (src.has_remaining)
              c = src.get
              input_size = 1
              if (Surrogate.is(c))
                if ((condensed_key = @sgp.parse(c, src)) < 0)
                  return @sgp.error
                end
                condensed_key += 0x1e248
                @current_state = GB18030_FOUR_BYTE
                input_size = 2
              else
                if (c >= 0x0 && c <= 0x7f)
                  @current_state = GB18030_SINGLE_BYTE
                else
                  if (c <= 0xa4c6 || c >= 0xe000)
                    out_byte_val = get_gb18030(EncoderIndex1, self.attr_encoder_index2, c)
                    if ((out_byte_val).equal?(0xfffd))
                      return CoderResult.unmappable_for_length(1)
                    end
                    hi_byte = (out_byte_val & 0xff00) >> 8
                    lo_byte = (out_byte_val & 0xff)
                    condensed_key = (hi_byte - 0x20) * 256 + lo_byte
                    if (c >= 0xe000 && c < 0xf900)
                      condensed_key += 0x82bd
                    else
                      if (c >= 0xf900)
                        condensed_key += 0x93a9
                      end
                    end
                    if (hi_byte > 0x80)
                      @current_state = GB18030_DOUBLE_BYTE
                    else
                      @current_state = GB18030_FOUR_BYTE
                    end
                  else
                    if (c >= 0xa4c7 && c <= 0xd7ff)
                      condensed_key = c - 0x5543
                      @current_state = GB18030_FOUR_BYTE
                    end
                  end
                end
              end
              if ((@current_state).equal?(GB18030_SINGLE_BYTE))
                if (dst.remaining < 1)
                  return CoderResult::OVERFLOW
                end
                dst.put(c)
              else
                if ((@current_state).equal?(GB18030_DOUBLE_BYTE))
                  if (dst.remaining < 2)
                    return CoderResult::OVERFLOW
                  end
                  dst.put(hi_byte)
                  dst.put(lo_byte)
                else
                  # Four Byte encoding
                  b1 = 0
                  b2 = 0
                  b3 = 0
                  b4 = 0
                  if (dst.remaining < 4)
                    return CoderResult::OVERFLOW
                  end
                  # Decompose the condensed key into its 4 byte equivalent
                  b4 = ((condensed_key % 10) + 0x30)
                  condensed_key /= 10
                  b3 = ((condensed_key % 126) + 0x81)
                  condensed_key /= 126
                  b2 = ((condensed_key % 10) + 0x30)
                  b1 = ((condensed_key / 10) + 0x81)
                  dst.put(b1)
                  dst.put(b2)
                  dst.put(b3)
                  dst.put(b4)
                end
              end
              mark += input_size
            end
            return CoderResult::UNDERFLOW
          ensure
            src.position(mark)
          end
        end
        
        typesig { [class_self::CharBuffer, class_self::ByteBuffer] }
        def encode_loop(src, dst)
          if (src.has_array && dst.has_array)
            return encode_array_loop(src, dst)
          else
            return encode_buffer_loop(src, dst)
          end
        end
        
        private
        alias_method :initialize__encoder, :initialize
      end }
    }
    
